import styled from '@emotion/styled'

const Ul = styled.ul`
  position: fixed;
  width: 210px;
  left: 0px;
  top: 0px;
  background: #FFFFFF;
`

const a = styled.a`
    display: block;
`


const Sidebar = () => (
    <div>
        <Ul>
            <a href="#">Занятия</a>
            <a href="#">Учащиеся</a>
            <a href="#">Тренеры</a>
            <a href="#">Финансы</a>
            <a href="#">Абонементы</a>
            <a href="#">Доступ в CRM</a>
            <a href="#">Рассылки</a>
            <a href="#">Отчеты</a>
            <a href="#">Настройки</a>
        </Ul>
    </div>
)

export default Sidebar;
